CREATE TABLE IF NOT EXISTS `calls_old` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `calldate` timestamp NULL DEFAULT NULL,
  `date` date DEFAULT NULL,
  `clid` varchar(80) NOT NULL,
  `src` varchar(80) NOT NULL,
